  let [info, setInfo] = useState([]);
  console.log(info);

  return (
    <div className="App">
      <HeaderComponent info={info} setInfo={setInfo}/>
      <ListComponent info={info} setInfo={setInfo}/>
    </div>
  );
}

export default App;
